/* Function: mdlInitializeSampleTimes =========================================
 * Abstract:
 *    Specifiy  the sample time.
 */
static void mdlInitializeSampleTimes(SimStruct *S)
{
    ssSetSampleTime(S, 0, SAMPLE_TIME_0);
    ssSetModelReferenceSampleTimeDefaultInheritance(S);
    ssSetOffsetTime(S, 0, 0.0);
}

#define MDL_SET_INPUT_PORT_DATA_TYPE
static void mdlSetInputPortDataType(SimStruct *S, int port, DTypeId dType)
{
    ssSetInputPortDataType(S, 0, dType);
}

#define MDL_SET_OUTPUT_PORT_DATA_TYPE
static void mdlSetOutputPortDataType(SimStruct *S, int port, DTypeId dType)
{
    ssSetOutputPortDataType(S, 0, dType);
}

#define MDL_SET_DEFAULT_PORT_DATA_TYPES
static void mdlSetDefaultPortDataTypes(SimStruct *S)
{
    ssSetInputPortDataType(S, 0, SS_DOUBLE);
    ssSetOutputPortDataType(S, 0, SS_DOUBLE);
}

#define MDL_SET_WORK_WIDTHS
#if defined(MDL_SET_WORK_WIDTHS) && defined(MATLAB_MEX_FILE)

static void mdlSetWorkWidths(SimStruct *S)
{
/* Set the width of DWork(s) used for marshalling the IOs */
    if (isBusDWorkPresent) {

        /* Update dwork 0 */
        ssSetDWorkWidth(S, 0, ssGetInputPortWidth(S, 2));

        /* Update dwork 1 */
        ssSetDWorkWidth(S, 1, ssGetInputPortWidth(S, 3));

        /* Update dwork 2 */
        ssSetDWorkWidth(S, 2, ssGetInputPortWidth(S, 4));

        /* Update dwork 3 */
        ssSetDWorkWidth(S, 3, ssGetInputPortWidth(S, 5));

        /* Update dwork 4 */
        ssSetDWorkWidth(S, 4, ssGetInputPortWidth(S, 6));

        /* Update dwork 5 */
        ssSetDWorkWidth(S, 5, ssGetOutputPortWidth(S, 1));

        /* Update dwork 6 */
        ssSetDWorkWidth(S, 6, ssGetOutputPortWidth(S, 2));

        /* Update dwork 7 */
        ssSetDWorkWidth(S, 7, ssGetOutputPortWidth(S, 3));

        /* Update dwork 8 */
        ssSetDWorkWidth(S, 8, ssGetOutputPortWidth(S, 4));

        /* Update dwork 9 */
        ssSetDWorkWidth(S, 9, ssGetOutputPortWidth(S, 6));

        /* Update dwork 10 */
        ssSetDWorkWidth(S, 10, ssGetOutputPortWidth(S, 7));

    }

}

#endif

